import WHtml2png from './src/WHtml2png.mjs'


let imga = ''
let imgb = ''
if (true) {

    imga = `data:image/png;base64,`

    imgb = `data:image/png;base64,`

}

async function testb() {

    let html = `
<div style="display:inline-block;">
    <div style="display:flex;">
        <div style="align-self:start;">
            <img src="${imga}" style="width:606px; height:391px;">
        </div>
        <div style="align-self:center;">
            <img src="${imgb}" style="width:295px; height:185px;">
        </div>
    </div>
</div>
    `
    let width = 901
    let height = 395
    let scale = 3

    let b64 = await WHtml2png(width, height, scale, html)
    // console.log('b64', b64)

    fs.writeFileSync('./test-sclb.png', b64, { encoding: 'base64' })

    console.log('finish')
}
testb()
    .catch((err) => {
        console.log(err)
    })

